Happy Album 💿 Announcement Day 📢 to everyone involved in this wonderful #PUCCINI PROJECT!  @dgclassics

I'm very pleased to share with you the news about my newest album " The Great Puccini " is now available for pre-order via Deutsche Grammophon. Looking forward to sharing this music with all of you and I'd like to offer a special thank you to my wonderful colleagues and orchestra who sound absolutely fabulous on this new release. And another special thank you for @dgclassics for producing this album -- they are a staple in keeping the classical music industry alive. Danke Schoen!

And as always #vivapuccini ❤️

For pre-order please click the link in my bio.

